import React, { Component } from "react";
import Iframe from "react-iframe";
import Pnav from "../Projects";

export default class Archrenderings extends Component {
  render() {
    return (
      <div>
        <Pnav />
        <iframe
          src="https://player.vimeo.com/video/364928434?autoplay=1&title=0&byline=0&portrait=0"
          width="640"
          height="360"
          frameborder="0"
          allow="autoplay; fullscreen"
          allowfullscreen
        ></iframe>

        <h1>park</h1>
      </div>
    );
  }
}
